import React from "react";
import {Container, Button} from "reactstrap"

const Home =() => {
    return (
        <div>
            <div>
            <Jumbotron>
                <h1>This is my first react page</h1>
            </Jumbotron>
            </div>
        </div>
    )
}

export default Home
